import MenuTopo from "./componentes/MenuTopo";
import Botao from "./componentes/Botao";
import EspacoBotoes from "./componentes/EspacoBotoes";

function App(props) {

  const jogos = [
    {
      nome: 'Jogo 1',
      imagem: '/imagens/grazinha.png'
    },
    {
      nome: 'Jogo 2',
      imagem: '/imagens/dashAndGetOut.png'
    },
    {
      nome: 'Jogo 3',
      imagem: '/imagens/pech.png'
    },
  ]

  return (
    <div className="App">
      <MenuTopo/>
      {jogos.map(jogo => <Botao nome={jogo.nome} imagem={jogo.imagem}/>)}

    </div>
  );
}

export default App;
